Эффективное и высококачественное средство по уходу за волосами, которое содержит маточное молочко, известное своими питательными свойствами. Эта маска глубоко проникает в структуру волос, увлажняет их, делая более мягкими, гладкими и шелковистыми. Данное средство помогает быстро восстановить и укрепить поврежденные локоны. Маска Fino Premium Touch имеет густую текстуру, которая интенсивно питает пряди, при этом не утяжеляя их. Отлично подойдет для всех типов волос, особенно сухих и «уставших» от частого термического или химического воздействия.
Активные компоненты маски от бренда Shiseido и их свойства:
маточное мелочно – питает волосы полезными микроэлементами, усиливает их рост и процесс регенерации;
гидролизованные протеины пшеницы – увлажняют и оживляют локоны, делают их эластичными;
сквалан – проникает в структуру волос, наполняет их жизненной силой и здоровым блеском;
сорбитол – удерживает влагу в прядях, делает их мягкими и защищенными от негативных воздействий окружающей среды;
липидный комплекс Lipidure EX – делает волосы крепкими и блестящими без ломкости и сечения.

Musk Kashmir Attar Collection — это аромат для мужчин и женщин, он принадлежит к группе цветочные древесно-мускусные.
Musk Kashmir выпущен в 2016 году.
Парфюмер: Luz Vaquero.
Верхняя нота: Белый перец;
Средние ноты: Гардения и Сандал;
Базовая нота: Белый мускус.

Cedrus Chloé — это аромат для мужчин и женщин, он принадлежит к группе древесные пряные.
Cedrus выпущен в 2019 году.
Парфюмер: Quentin Bisch.
Верхние ноты: кардамон;
Ноты сердца: древесные ноты, дубовый мох;
Базовые ноты: ветивер, сандал.

Pacific Chill Louis Vuitton — аромат unisex, принадлежит к группе фужерные фруктовые.
Pacific Chill выпущен в 2023 году.
Парфюмер: Jacques Cavallier Belletrud. Верхние ноты: Цитрон, Мята, Апельсин, Лимон, Черная смородина и Кориандр;
Средние ноты: Абрикос, Базилик, Семена моркови и Майская роза;
Базовые ноты: Инжир, Финики и Амбретта.

Travel-набор средств с берёзовым соком Round Lab Birch Juice Trial Kit — идеальный формат для знакомства с линией увлажняющих продуктов бренда. Их действие направлено на восполнение дефицита влаги и оптимизацию защитных функций кожи. Средства поддерживают естественный pH-баланс и целостность гидролипидной мантии, снижают чувствительность и реактивность.
Комплектация:
Увлажняющий гель для умывания с березовым соком 30 мл;
Увлажняющий тоник с берёзовым соком 20 мл;
Липосомальная ампула для интенсивного увлажнения 10 мл;
Увлажняющий крем для чувствительной кожи с берёзовым соком 20 мл.
